<pre><code>var answerSchema = new mongoose.Schema({
  username: {
    type: String,
    unique: true,
    required: true
  }
)
mongoose.model(&quot;Answer&quot;, answerSchema)
</code></pre>
<p>and in another file I have:</p>
<pre><code>var Answer = mongoose.model(&quot;Answer&quot;)
