Nodejs & mongodb: Insert record if it does not exist. Else insert new record if changed since last record (Unhandled promise rejection)<p>I am monitoring prices from the local supermarket and have succesfully retrieved them all in one big json. A product would be something like { id, name, price, timestamp }.</p>
<pre><code>    for (let i = 0; i &lt; productList.length; i++) {
        let productObj = productList[i];

        await db.collection(&quot;products&quot;).findOne({&quot;id&quot; : productObj.id}, async function(err, result) {
            if (err) {
                console.log(&quot;Did not find product id: &quot; + productObj.id);
                await db.collection(&quot;products&quot;).insertOne(productObj), function(err, res) {
                    if (err) throw err;
                };
                console.log(&quot;Done inserting&quot;);
            }
            // else insert new record if price changed
            // keep previous records for history
            console.log(&quot;Looking for product: &quot; + result.name);
        });
    }
</code></pre>
<p>Unfortunately this give the error:</p>
<pre><code>(node:37316) UnhandledPromiseRejectionWarning: Unhandled promise rejection. This error originated either by throwing inside of an async function without a catch block, or by rejecting a promise which was not handled with .catch(). (rejection id: 70)
</code></pre>
<p>How do I correctly loop through the products and insert a product if it does not exist? Else I want to insert if price changed, so I cannot use the upsert functionality.</p>
<p>Do I just need to catch the error thrown inside the loop or what would the correct way be to handle this?</p>

