Why is this array considered to be an object, and how to handle it?<p>Good morning everyone!
I have a little issue. I want to check for a field in the DB and I want to store it into a variable. To do so I did this:</p>
<pre><code>async function buildUsername(value) {
    const { db } = await connectToDatabase(URI, DATABASE);
    let obj = await db.collection(COLLECTION).find({username: value}).toArray()
    //here I want to do something like: let username = obj.username
    return typeof obj
}
</code></pre>
<p>This returns me <em><strong>object</strong></em>.</p>
<p>If I log <strong>obj</strong> it outputs a structure like the following:</p>
<pre><code>[
    {
        name: &quot;tom&quot;
        username: &quot;tomhopkins&quot;
        //etc...

    }
]
</code></pre>
<p>I want to access the username and store it into a variable. If I do: <code>username = obj[0].username</code> it doesn't work because it says <strong>obj</strong> is not an array, it is an object.</p>
<p>I have to say that I can't do it with callbacks because I need to return a username that is not already stored in the DB.</p>
<p><em>For example</em>: if there is stored a document with username &quot;tomhanks&quot; and there is another person with the same name, I can't register the same username. I call the function username, add a suffix (an integer at the end) and check again if there is another one.if there is not then I return it, otherwise i call the function recursively with the <code>username + suffix</code> and so on.</p>
<p>Any suggestions?</p>
<p>Thank you very much!</p>

